import React from 'react';
import Navbar from './Navbar';
import Footern from './footer/Footern';

function App() {
  return (
    <div className="App">
      <Navbar />
      <main style={{ minHeight: '60vh' }}></main>
      <Footern />
    </div>
  );
}

export default App;
